(1, 'welcome-to-email-subscribers', 'Welcome To Email Subscribers', 'newsletter', NULL, NULL, 'Welcome To Email Subscribers', '<strong style=\"color: #990000\">What can you achieve using Email Subscribers?</strong><p>Add subscription forms on website, send HTML newsletters. You can also Import or Export subscribers from any list to Email Subscribers.</p> <strong style=\"color: #990000\">Plugin Features</strong><ol> <li>Send notification emails to subscribers when new blog posts are published.</li> <li>Subscribe form available with 3 options to setup.</li> <li>Double Opt-In and Single Opt-In support.</li> <li>Email notification to admin when a new user signs up (Optional).</li> <li>Automatic welcome email to subscriber.</li> <li>Auto add unsubscribe link in the email.</li> <li>Import/Export subscriber emails to migrate to any lists.</li> <li>Default WordPress editor to create emails.</li> </ol> <strong>Thanks & Regards,</strong><br/>Admin<br/>', 'Greeny', 'test@test.dk', 'Greeny', 'test@test.dk', '', '1', 32, 1, NULL, '2020-12-09 12:05:35', NULL, NULL),
(2, 'test', 'test', 'newsletter', NULL, NULL, 'test', '<h1>Test mail</h1>\r\nhello: {FIRSTNAME}} {{LASTNAME}}\r\n\r\nTest mail\r\n\r\nTest mail\r\n\r\n{{EMAIL}}, {{DATE}}, {{POSTTITLE}}, {{POSTIMAGE}}, {{POSTEXCERPT}}, {{POSTDESC}}, {{POSTAUTHOR}}, {{POSTLINK}}, {{POSTLINK-WITHTITLE}}, {{POSTLINK-ONLY}}, {{POSTFULL}}', 'Greeny', 'test@test.dk', 'Greeny', 'test@test.dk', '', '2', 89, 1, 'a:4:{s:20:\"enable_open_tracking\";s:3:\"yes\";s:10:\"pre_header\";s:0:\"\";s:4:\"type\";s:8:\"one_time\";s:4:\"date\";s:19:\"2021-01-02 18:33:48\";}', '2021-01-02 18:32:35', '2021-01-02 18:33:48', NULL);
