(239, 25, 'ingredients_fields', 'a:6:{i:0;a:4:{s:5:\"title\";s:8:\"Beetroot\";s:4:\"text\";s:145:\"        Beets are full vitamins and minerals.They provide pigments and inorganic nitrates. Both of which have a number of health benefits        \";s:10:\"percentage\";s:1:\"2\";s:5:\"image\";s:2:\"82\";}i:1;a:4:{s:5:\"title\";s:9:\"Raspberry\";s:4:\"text\";s:144:\"        :An amazing source of vitamin C. They can also positively impact your blood sugar because of their high fiber and tannin content        \";s:10:\"percentage\";s:1:\"3\";s:5:\"image\";s:2:\"83\";}i:2;a:4:{s:5:\"title\";s:5:\"Apple\";s:4:\"text\";s:341:\"         We can find almost every vitamin possible as well as antioxidants such as beta-carotene, lutein, zeaxanthin, cryptoxanthin and flavonoids. Apple also has a solid portion of calcium, iron, copper, sodium, iodine, potassium, zinc, magnesium, manganese, fluorine, sulfur and phosphorus. So basically it has everything you need!        \";s:10:\"percentage\";s:1:\"2\";s:5:\"image\";s:2:\"55\";}i:3;a:4:{s:5:\"title\";s:8:\"Rose hip\";s:4:\"text\";s:208:\"         Compared to other fruits and vegetables rose hips contain one of the highest levels of vitamin C. This vitamin and other compounds which are in rose hips, helps to protect your immune system.        \";s:10:\"percentage\";s:1:\"1\";s:5:\"image\";s:2:\"94\";}i:4;a:4:{s:5:\"title\";s:16:\"Black elderberry\";s:4:\"text\";s:150:\"         this amazing fruit is packed with vitamin C\r\n\r\ndietary fiber and antioxidants in the form phenolic acids, flavonols and anthocyanins.        \";s:10:\"percentage\";s:1:\"2\";s:5:\"image\";s:2:\"93\";}i:5;a:4:{s:5:\"title\";s:9:\"Blueberry\";s:4:\"text\";s:145:\"         Unbeatable antioxidant among all of the fruits and vegetables. It is high in fibers and contain a lot of vitamin C and vitamin K        \";s:10:\"percentage\";s:1:\"1\";s:5:\"image\";s:2:\"85\";}}'),
