(252, 10, 'ingredients_fields', 'a:6:{i:0;a:4:{s:5:\"title\";s:5:\"Mango\";s:4:\"text\";s:168:\"            Is a natural source of energy! Full of vitamin A,B,C and K.\r\n\r\nAnd thanks to a mix of magnesium and potassium it can also help to reduce stress.            \";s:10:\"percentage\";s:1:\"5\";s:5:\"image\";s:2:\"61\";}i:1;a:4:{s:5:\"title\";s:9:\"Pineapple\";s:4:\"text\";s:205:\"             \r\nHas a huge dose of vitamin C and thanks to the high content of magnesium, manganese and thiamine, it is a natural source of energy.\r\n\r\nPlus, itâs delicious and low in calories.            \";s:10:\"percentage\";s:1:\"5\";s:5:\"image\";s:2:\"57\";}i:2;a:4:{s:5:\"title\";s:8:\"Turmeric\";s:4:\"text\";s:100:\"            \r\nIt has antioxidant properties but also strong anti-inflammatory effects.\r\n            \";s:10:\"percentage\";s:1:\"5\";s:5:\"image\";s:2:\"60\";}i:3;a:4:{s:5:\"title\";s:5:\"Apple\";s:4:\"text\";s:351:\"             \r\nWe can find almost every vitamin possible as well as antioxidants such as beta-carotene, lutein, zeaxanthin, cryptoxanthin and flavonoids. Apple also has a solid portion of calcium, iron, copper, sodium, iodine, potassium, zinc, magnesium, manganese, fluorine, sulfur and phosphorus. So basically it has everything you need!            \";s:10:\"percentage\";s:1:\"5\";s:5:\"image\";s:2:\"58\";}i:4;a:4:{s:5:\"title\";s:14:\" Passion fruit\";s:4:\"text\";s:161:\"            It is not only very delicious and exotic but is rich in antioxidants and vitamin A which is good for your skin, vision and immune system.            \";s:10:\"percentage\";s:1:\"5\";s:5:\"image\";s:2:\"62\";}i:5;a:4:{s:5:\"title\";s:15:\" Coconut cream \";s:4:\"text\";s:280:\"            Coconut is a valuable source of iron, potassium, magnesium, calcium, phosphorus, sodium and zinc. In coconut we can also find vitamin C, thiamine, riboflavin, niacin, vitamin B6, folic acid, vitamin E and vitamin K. Coconut is also a great source of fiber.            \";s:10:\"percentage\";s:1:\"5\";s:5:\"image\";s:2:\"59\";}}'),
