(318, 24, 'ingredients_fields', 'a:6:{i:0;a:4:{s:5:\"title\";s:7:\"Spinach\";s:4:\"text\";s:183:\"      An amazing source of vitamin E, vitamin A, Vitamin C, iron, folate, magnesium, fiber and plant protein. It is nutrient-rich food which should be included in everyday diet.      \";s:10:\"percentage\";s:1:\"1\";s:5:\"image\";s:2:\"76\";}i:1;a:4:{s:5:\"title\";s:9:\"Pineapple\";s:4:\"text\";s:191:\"       : Has a huge dose of vitamin C and thanks to the high content of magnesium, manganese and thiamine, it is a natural source of energy.\r\n\r\nPlus, it\'s delicious and low in calories.      \";s:10:\"percentage\";s:1:\"2\";s:5:\"image\";s:2:\"77\";}i:2;a:4:{s:5:\"title\";s:6:\"Ginger\";s:4:\"text\";s:195:\"       We can say so many things about adding ginger to your diet. Besides it tastes delicious, this superfood has antioxidant and anti-inflammatory properties which is great for your body.      \";s:10:\"percentage\";s:1:\"3\";s:5:\"image\";s:2:\"78\";}i:3;a:4:{s:5:\"title\";s:5:\"Apple\";s:4:\"text\";s:337:\"       We can find almost every vitamin possible as well as antioxidants such as beta-carotene, lutein, zeaxanthin, cryptoxanthin and flavonoids. Apple also has a solid portion of calcium, iron, copper, sodium, iodine, potassium, zinc, magnesium, manganese, fluorine, sulfur and phosphorus. So basically it has everything you need!      \";s:10:\"percentage\";s:1:\"4\";s:5:\"image\";s:2:\"79\";}i:4;a:4:{s:5:\"title\";s:9:\"Spirulina\";s:4:\"text\";s:178:\"       extremely high in many nutrients, may reduce blood pressure, powerful antioxidant and anti-inflammatory properties. This blue-green algae just must be in your diet !      \";s:10:\"percentage\";s:1:\"1\";s:5:\"image\";s:2:\"80\";}i:5;a:4:{s:5:\"title\";s:10:\"Matcha tea\";s:4:\"text\";s:203:\"       Well-known in Japan for its wonderful taste and health benefits. It is rich in antioxidants called polyphenols, which have been tied to protection against heart disease and boost metabolism.      \";s:10:\"percentage\";s:1:\"3\";s:5:\"image\";s:2:\"95\";}}'),
