(14, 1, '2020-12-07 18:17:05', '2020-12-07 18:17:05', '<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like piÃ±a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost:8000/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->', 'About us', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2020-12-07 18:17:05', '2020-12-07 18:17:05', '', 2, 'http://localhost:8000/?p=14', 0, 'revision', '', 0),
(15, 1, '2020-12-07 18:17:42', '2020-12-07 18:17:42', '<!-- wp:paragraph -->\n<p>How did we come up with this idea?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You get up in the morning, take a few sips of coffee, have a long busy day ahead, a quick lunch, and you go back to work or study again, then go out with your friends,dog, pick up the kids from school, do your homework and get ready for the next day.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Everyone has a lot to do every day.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We wanted to create something simple that will make you find a moment in a day to do something for yourself.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Regardless of whether you need more energy,boost immunity or detox, our juices will help you fulfill these needs!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We are from Europe!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>All of our ingredients come from Polish suppliers and we know that they are high quality!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'About us', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2020-12-07 18:17:42', '2020-12-07 18:17:42', '', 2, 'http://localhost:8000/?p=15', 0, 'revision', '', 0),
