(64, 1, '2020-12-13 13:18:04', '2020-12-13 13:18:04', '<!-- wp:heading -->\n<h2>What are GREENY powdered juices?</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>It is nothing but powdered fruits and vegetables!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Is powdered juice healthy?<br></strong>Dried fruits and vegetables are as healthy as in a traditional form :)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>How to prepare it?<br></strong>Simply add a powder to 300ml of water or any type of milk, shake it and enjoy it!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Are GREENY juices suitable for vegans?<br></strong>Yes, our juices donât contain products of animal origin.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Where do the ingredients come from?<br></strong>Our ingredients are provided by Polish suppliers, but exotic ingredients like matcha or turmeric are collected from around the world.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Do GREENY juices really help for immunity, detoxicating and boost energy?<br></strong>Yes! Mixes were carefully composed so the ingredients inside of each mix support immunity, help with detoxification and boost energy.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>How many calories are in one juice?<br></strong>-Here we are waiting for the answer from the supplier.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Can I give GREENY juices to my kids?<br></strong>Yes!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>REDDY juice and YELLOW juice is suitable for children over 2 years of age and GREENY juice for kids over 10 years of age.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2><strong>DELIVERY AND ORDERS</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><strong>How fast will I receive my order?<br></strong>Answer</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>What are the available methods of payment?<br></strong>Answer</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Can I make a complaint?<br></strong>Answer</p>\n<!-- /wp:paragraph -->', 'FAQ', '', 'inherit', 'closed', 'closed', '', '39-revision-v1', '', '', '2020-12-13 13:18:04', '2020-12-13 13:18:04', '', 39, 'http://localhost:8000/39-revision-v1/', 0, 'revision', '', 0),
