(178, 'What personal data we collect and why we collect it', '', 0, 0, 178),
(179, 'When visitors leave reviews on the site we collect the data shown in the reviews form, and also the visitorâs IP address and browser user agent string to help spam detection.', '', 0, 0, 179),
(180, 'Media', '', 0, 0, 180),
(181, 'If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.', '', 0, 0, 181),
(182, 'Cookies', '', 0, 0, 182),
(183, 'If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.', '', 0, 0, 183),
(184, 'If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.', '', 0, 0, 184),
(185, 'When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &#8220;Remember Me&#8221;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.', '', 0, 0, 185),
(186, 'If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.', '', 0, 0, 186),
(187, 'Embedded content from other websites', '', 0, 0, 187),
(188, 'Blog posts on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.', '', 0, 0, 188),
(189, 'These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.', '', 0, 0, 189),
(190, 'Who we share your data with', '', 0, 0, 190),
(191, 'How long we retain your data', '', 0, 0, 191),
(192, 'If you leave a review, the review and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.', '', 0, 0, 192),
(193, 'For users that register on our website, we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time. Website administrators can also see and edit that information.', '', 0, 0, 193),
(194, 'What rights you have over your data', '', 0, 0, 194),
(195, 'If you have an account on this site, or have left reviews, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.', '', 0, 0, 195),
(196, 'Where we send your data', '', 0, 0, 196),
