(3257, 'Who we are', '', 'default', 0),
(3258, 'In this section you should note your site URL, as well as the name of the company, organization, or individual behind it, and some accurate contact information.', '', 'default', 0),
(3259, 'The amount of information you may be required to show will vary depending on your local or national business regulations. You may, for example, be required to display a physical address, a registered address, or your company registration number.', '', 'default', 0),
(3260, 'Our website address is: %s.', '', 'default', 0),
(3261, 'What personal data we collect and why we collect it', '', 'default', 0),
(3262, 'In this section you should note what personal data you collect from users and site visitors. This may include personal data, such as name, email address, personal account preferences; transactional data, such as purchase information; and technical data, such as information about cookies.', '', 'default', 0),
(3263, 'You should also note any collection and retention of sensitive personal data, such as data concerning health.', '', 'default', 0),
(3264, 'In addition to listing what personal data you collect, you need to note why you collect it. These explanations must note either the legal basis for your data collection and retention or the active consent the user has given.', '', 'default', 0),
(3265, 'Personal data is not just created by a user&#8217;s interactions with your site. Personal data is also generated from technical processes such as contact forms, comments, cookies, analytics, and third party embeds.', '', 'default', 0),
(3266, 'By default WordPress does not collect any personal data about visitors, and only collects the data shown on the User Profile screen from registered users. However some of your plugins may collect personal data. You should add the relevant information below.', '', 'default', 0),
(3267, 'In this subsection you should note what information is captured through comments. We have noted the data which WordPress collects by default.', '', 'default', 0),
(3268, 'When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.', '', 'default', 0),
(3269, 'An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.', '', 'default', 0),
(3270, 'Media', '', 'default', 0),
(3271, 'In this subsection you should note what information may be disclosed by users who can upload media files. All uploaded files are usually publicly accessible.', '', 'default', 0),
(3272, 'If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.', '', 'default', 0),
(3273, 'Contact forms', '', 'default', 0),
(3274, 'By default, WordPress does not include a contact form. If you use a contact form plugin, use this subsection to note what personal data is captured when someone submits a contact form, and how long you keep it. For example, you may note that you keep contact form submissions for a certain period for customer service purposes, but you do not use the information submitted through them for marketing purposes.', '', 'default', 0),
(3275, 'Cookies', '', 'default', 0),
(3276, 'In this subsection you should list the cookies your web site uses, including those set by your plugins, social media, and analytics. We have provided the cookies which WordPress installs by default.', '', 'default', 0),
(3277, 'If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.', '', 'default', 0),
(3278, 'If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.', '', 'default', 0),
(3279, 'When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.', '', 'default', 0),
(3280, 'If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.', '', 'default', 0),
(3281, 'Embedded content from other websites', '', 'default', 0),
(3282, 'Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.', '', 'default', 0),
(3283, 'These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.', '', 'default', 0),
(3284, 'Analytics', '', 'default', 0),
(3285, 'In this subsection you should note what analytics package you use, how users can opt out of analytics tracking, and a link to your analytics provider&#8217;s privacy policy, if any.', '', 'default', 0),
(3286, 'By default WordPress does not collect any analytics data. However, many web hosting accounts collect some anonymous analytics data. You may also have installed a WordPress plugin that provides analytics services. In that case, add information from that plugin here.', '', 'default', 0),
(3287, 'Who we share your data with', '', 'default', 0),
(3288, 'In this section you should name and list all third party providers with whom you share site data, including partners, cloud-based services, payment processors, and third party service providers, and note what data you share with them and why. Link to their own privacy policies if possible.', '', 'default', 0),
(3289, 'By default WordPress does not share any personal data with anyone.', '', 'default', 0),
(3290, 'How long we retain your data', '', 'default', 0),
(3291, 'In this section you should explain how long you retain personal data collected or processed by the web site. While it is your responsibility to come up with the schedule of how long you keep each dataset for and why you keep it, that information does need to be listed here. For example, you may want to say that you keep contact form entries for six months, analytics records for a year, and customer purchase records for ten years.', '', 'default', 0),
(3292, 'If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.', '', 'default', 0),
(3293, 'For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.', '', 'default', 0),
(3294, 'What rights you have over your data', '', 'default', 0),
(3295, 'In this section you should explain what rights your users have over their data and how they can invoke those rights.', '', 'default', 0),
(3296, 'If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.', '', 'default', 0),
(3297, 'Where we send your data', '', 'default', 0),
(3298, 'In this section you should list all transfers of your site data outside the European Union and describe the means by which that data is safeguarded to European data protection standards. This could include your web hosting, cloud storage, or other third party services.', '', 'default', 0),
(3299, 'European data protection law requires data about European residents which is transferred outside the European Union to be safeguarded to the same standards as if the data was in Europe. So in addition to listing where data goes, you should describe how you ensure that these standards are met either by yourself or by your third party providers, whether that is through an agreement such as Privacy Shield, model clauses in your contracts, or binding corporate rules.', '', 'default', 0),
(3300, 'Visitor comments may be checked through an automated spam detection service.', '', 'default', 0),
(3301, 'Your contact information', '', 'default', 0),
(3302, 'In this section you should provide a contact method for privacy-specific concerns. If you are required to have a Data Protection Officer, list their name and full contact details here as well.', '', 'default', 0),
(3303, 'Additional information', '', 'default', 0),
(3304, 'If you use your site for commercial purposes and you engage in more complex collection or processing of personal data, you should note the following information in your privacy policy in addition to the information we have already discussed.', '', 'default', 0),
(3305, 'How we protect your data', '', 'default', 0),
(3306, 'In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.', '', 'default', 0),
(3307, 'What data breach procedures we have in place', '', 'default', 0),
(3308, 'In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.', '', 'default', 0),
(3309, 'What third parties we receive data from', '', 'default', 0),
(3310, 'If your web site receives data about users from third parties, including advertisers, this information must be included within the section of your privacy policy dealing with third party data.', '', 'default', 0),
(3311, 'What automated decision making and/or profiling we do with user data', '', 'default', 0),
(3312, 'If your web site provides a service which includes automated decision making - for example, allowing customers to apply for credit, or aggregating their data into an advertising profile - you must note that this is taking place, and include information about how that information is used, what decisions are made with that aggregated data, and what rights users have over decisions made without human intervention.', '', 'default', 0),
(3313, 'Industry regulatory disclosure requirements', '', 'default', 0),
(3314, 'If you are a member of a regulated industry, or if you are subject to additional privacy laws, you may be required to disclose that information here.', '', 'default', 0),
