(3333, 'Cookie Sensitivity', '', 'cookie-law-info', 0),
(3334, 'This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.', '', 'woocommerce', 0),
(3335, 'We collect information about you during the checkout process on our store.', '', 'woocommerce', 0),
(3336, 'What we collect and store', '', 'woocommerce', 0),
(3337, 'While you visit our site, weâll track:', '', 'woocommerce', 0),
(3338, 'Products youâve viewed:  weâll use this to, for example, show you products youâve recently viewed', '', 'woocommerce', 0),
(3339, 'Location, IP address and browser type: weâll use this for purposes like estimating taxes and shipping', '', 'woocommerce', 0),
(3340, 'Shipping address: weâll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!', '', 'woocommerce', 0),
